import React from "react";
import Slider from "react-slick";

import RecentItems from "../recent-items";

var settings = {
  dots: true,
  arrow: false,
  infinite: true,
  speed: 500,
  slidesToShow: 4,
  slidesToScroll: 1,
  centerMode: true,
  pauseOnHover: true,
  adaptiveHeight: true,
  centerPadding: "60px",
  responsive: [
    {
      breakpoint: 768,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1,
      },
    },
  ],
};

const RecentActivities = ({ postData }) => {
  return (
    <React.Fragment>
      <div className="recent-container">
        <h2>Recent Activities</h2>
      </div>

      <div className="recent-item-container">
        <Slider {...settings}>
          {postData.map((post) => (
            <RecentItems key={postData} postData={post} />
          ))}
          {/* <RecentItems />
          <RecentItems />
          <RecentItems />
          <RecentItems />
          <RecentItems /> */}
        </Slider>
      </div>
    </React.Fragment>
  );
};

export default RecentActivities;
